import React from 'react'

function ListPlayers({players}) {
  const listplayers = players.map( player => {
    <div>player.player_name</div>
  })
  return (
    <div>
      <div className='contentContainer' style={{width:'10rem'}}></div>
      <div>
        {listplayers}
      </div>
    </div>
  )
}

export default ListPlayers
